class IconSearcher {
  final Map<String, IconData> _all; // icon name -> IconData
  final Map<String, List<String>> _tagsMap; // tag -> icon names
  late final List<String> _lowerIconKeys;
  late final List<String> _originalIconNames; // Original case icon names for O(1) lookup
  late final List<String> _tagKeys; // Consistent tag key ordering
  late final List<String> _allNames;
  final Map<String, Uint32List> _gramIndex = {}; // Changed to Uint32List for >65k items
  final int n;

  // configurable singleton
  // static IconSearcher? _instance;

  // factory IconSearcher.instance({Map<String, IconData>? all, Map<String, List<String>>? tagsMap, int n = 2}) {
  //   all ??= {};
  //   tagsMap ??= {};
  //   _instance ??= IconSearcher._internal(all, tagsMap, n);
  //   return _instance!;
  // }

  // IconSearcher._internal(this._all, this._tagsMap, this.n) {
  //   _lowerIconKeys = _all.keys.map((e) => e.toLowerCase()).toList();
  //   _originalIconNames = _all.keys.toList();
  //   _tagKeys = _tagsMap.keys.toList();
  //   _allNames = _all.keys.toList();
  //   _buildIndex();
  // }

  // Time Complexity: O(N * L) where N = total icons+tags, L = average name length
  // Space Complexity: O(N * L * G) where G = average grams per name
  IconSearcher({Map<String, IconData>? all, Map<String, List<String>>? tagsMap, this.n = 2})
    : _all = all ?? {},
      _tagsMap = tagsMap ?? {} {
    _originalIconNames = _all.keys.toList(); // Store original case names
    _lowerIconKeys = _originalIconNames.map((k) => k.toLowerCase()).toList();
    _tagKeys = _tagsMap.keys.toList(); // Store consistent tag key ordering
    _buildIndex();
  }

  // Time Complexity: O(L) where L = string length
  // Space Complexity: O(L) for the result string
  // Simple and fast normalize - just lowercase, keep alphanumeric
  String _normalize(String s) => s.toLowerCase().replaceAll(RegExp(r'[^a-z0-9]'), '');

  // Time Complexity: O(N * L^2) where N = total icons+tags, L = average name length
  // Space Complexity: O(G * N) where G = average grams per name
  // Builds n-gram inverted index for fast substring searching
  void _buildIndex() {
    final temp = <String, List<int>>{};
    _allNames = [];

    // Index icon names
    for (int id = 0; id < _lowerIconKeys.length; id++) {
      final name = _lowerIconKeys[id];
      _allNames.add(name);
      final normName = _normalize(name);
      final seen = <String>{};
      for (int i = 0; i <= normName.length - n; i++) {
        final gram = normName.substring(i, i + n);
        if (seen.add(gram)) temp.putIfAbsent(gram, () => []).add(id);
      }
    }

    // Index tags
    for (int i = 0; i < _tagKeys.length; i++) {
      final tag = _tagKeys[i].toLowerCase();
      final aliasId = _allNames.length;
      _allNames.add(tag);
      final normTag = _normalize(tag);
      final seen = <String>{};
      for (int j = 0; j <= normTag.length - n; j++) {
        final gram = normTag.substring(j, j + n);
        if (seen.add(gram)) temp.putIfAbsent(gram, () => []).add(aliasId);
      }
    }

    temp.forEach((gram, ids) {
      ids.sort();
      _gramIndex[gram] = Uint32List.fromList(ids); // Changed to Uint32List
    });
  }

  // Time Complexity: O(Q + R) where Q = query processing time, R = result set size
  // Space Complexity: O(R) for the result set
  // Fast search using n-gram index with exact tag matching
  List<String> search(String query) {
    final results = <String>{};

    // Exact tag match
    final exact = _tagsMap[query];
    if (exact != null) results.addAll(exact);

    final normQuery = _normalize(query);
    if (normQuery.isEmpty) return results.toList();

    final candidateIds = _searchByGram(normQuery);

    // Debug: Print some info for troubleshooting
    if (query.contains('icon7999') && candidateIds.isEmpty) {
      // loggy.debug('Debug: No candidates found for normalized query: "$normQuery"');
      // loggy.debug(
      //   'Debug: Available grams starting with "ic": ${_gramIndex.keys.where((k) => k.startsWith('ic')).take(5)}',
      // );
    }

    for (final id in candidateIds) {
      if (id < _lowerIconKeys.length) {
        // Icon name - O(1) access to original case name
        results.add(_originalIconNames[id]);
      } else {
        // Tag - use pre-stored consistent indexing
        final tagIndex = id - _lowerIconKeys.length;
        if (tagIndex < _tagKeys.length) {
          final tagKey = _tagKeys[tagIndex];
          final tagValues = _tagsMap[tagKey];
          if (tagValues != null) {
            results.addAll(tagValues);
          }
        }
      }
    }

    return results.toList();
  }

  // Time Complexity: O(K * log(M)) where K = query grams, M = average posting list size
  // Space Complexity: O(C) where C = candidate set size
  // For short queries (<n chars): O(N * L) where N = total names, L = name length
  Set<int> _searchByGram(String normQuery) {
    if (normQuery.length < n) {
      final out = <int>{};
      for (int i = 0; i < _allNames.length; i++) {
        if (_normalize(_allNames[i]).contains(normQuery)) out.add(i);
      }
      return out;
    }

    final postingLists = <Uint32List>[]; // Changed to Uint32List
    for (int i = 0; i <= normQuery.length - n; i++) {
      final gram = normQuery.substring(i, i + n);
      final postings = _gramIndex[gram];
      if (postings == null) return {};
      postingLists.add(postings);
    }

    return _intersect(postingLists, normQuery);
  }

  // Time Complexity: O(P * M * log(M)) where P = posting lists count, M = smallest list size
  // Space Complexity: O(M) for the result set
  // Intersects multiple posting lists to find common candidates
  Set<int> _intersect(List<Uint32List> lists, String normQuery) {
    // Changed to Uint32List
    if (lists.isEmpty) return {};

    lists.sort((a, b) => a.length.compareTo(b.length));
    final smallest = lists.first;
    final result = <int>{};

    for (final candidate in smallest) {
      bool presentInAll = true;
      for (int i = 1; i < lists.length; i++) {
        if (!_binarySearch(lists[i], candidate)) {
          presentInAll = false;
          break;
        }
      }

      if (presentInAll && _normalize(_allNames[candidate]).contains(normQuery)) {
        result.add(candidate);
      }
    }

    return result;
  }

  // Time Complexity: O(log N) where N = list length
  // Space Complexity: O(1)
  // Standard binary search on sorted array
  bool _binarySearch(Uint32List list, int value) {
    // Changed to Uint32List
    int low = 0, high = list.length - 1;
    while (low <= high) {
      final mid = (low + high) >> 1;
      final midVal = list[mid];
      if (midVal == value) return true;
      if (midVal < value) {
        low = mid + 1;
      } else {
        high = mid - 1;
      }
    }
    return false;
  }
}
